description:
Shadowbane Alpha/Beta Pics v2.0.


Screenshots from June 1999 through March 2003.


Removed 60 duplicate images, added 125 new images.


Includes concept art for buildings, races, classes, disciplines, bestiary, guild crests, maps, including hand-drawn material.  Also contains lore and all of the beta war and diplomacy reports in .rtf format.

609 images in all.
